pragma solidity >=0.5.0 <0.6.0;

import "./math.sol";
import "./LCTBase.sol";

contract Context {

    function _msgSender() internal view returns (address payable) {
        return msg.sender;
    }

    function _msgData() internal view returns (bytes memory) {
        this;
        return msg.data;
    }
}

interface IERC165 {
    function supportsInterface(bytes4 interfaceId) external view returns (bool);
}

contract IERC721 is IERC165 {
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);
    
    function balanceOf(address owner) public view returns (uint256 balance);
    function ownerOf(uint256 tokenId) public view returns (address owner);
    
    function safeTransferFrom(address from, address to, uint256 tokenId) public;
    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory data) public;
    function transferFrom(address from, address to, uint256 tokenId) public;
    
    function approve(address to, uint256 tokenId) public;
    function getApproved(uint256 tokenId) public view returns (address operator);
    function setApprovalForAll(address operator, bool _approved) public;
    function isApprovedForAll(address owner, address operator) public view returns (bool);
    
}

contract IERC721Receiver {
    
    function onERC721Received(address operator, address from, uint256 tokenId, bytes memory data)
    public returns (bytes4);
}

library Address {
    
    function isContract(address account) internal view returns (bool) {

        bytes32 codehash;
        bytes32 accountHash = 0xc5d2460186f7233c927e7db2dcc703c0e500b653ca82273b7bfad8045d85a470;
        
        assembly { codehash := extcodehash(account) }
        return (codehash != 0x0 && codehash != accountHash);
    }

    
    function toPayable(address account) internal pure returns (address payable) {
        return address(uint160(account));
    }
}

library Counters {
    using SafeMath for uint256;

    struct Counter {

        uint256 _value;
    }

    function current(Counter storage counter) internal view returns (uint256) {
        return counter._value;
    }

    function increment(Counter storage counter) internal {
        
        counter._value += 1;
    }

    function decrement(Counter storage counter) internal {
        counter._value = counter._value.sub(1);
    }
}

contract ERC165 is IERC165 {
    
    bytes4 private constant _INTERFACE_ID_ERC165 = 0x01ffc9a7;

    mapping(bytes4 => bool) private _supportedInterfaces;

    constructor () internal {
        _registerInterface(_INTERFACE_ID_ERC165);
    }

    function supportsInterface(bytes4 interfaceId) external view returns (bool) {
        return _supportedInterfaces[interfaceId];
    }

    function _registerInterface(bytes4 interfaceId) internal {
        require(interfaceId != 0xffffffff, "ERC165: invalid interface id");
        _supportedInterfaces[interfaceId] = true;
    }
}

contract ERC721 is Context, ERC165, IERC721 {
    using SafeMath for uint256;
    using MathTool for uint256;
    using Address for address;
    using Counters for Counters.Counter;
    using LCTBase for LCTBase.lctbase;
    using LCTInfo for LCTInfo.amount;

    mapping(address => LCTBase.lctbase) lct;

    mapping(uint => cat) $luckyCats;

    LCTInfo.amount LCTAomunt = LCTInfo.amount(0, 0, 0);

    struct cat{
        uint8 typ;
    }

    bytes4 private constant _ERC721_RECEIVED = 0x150b7a02;

    //mapping (address => uint[]) _ownTokens;
    
    mapping (uint256 => address) private _tokenOwner;
    mapping (uint256 => address) private _tokenApprovals;
    mapping (address => Counters.Counter) private _ownedTokensCount;
    mapping (address => mapping (address => bool)) private _operatorApprovals;
    
    bytes4 private constant _INTERFACE_ID_ERC721 = 0x80ac58cd;

    constructor () public {
        _registerInterface(_INTERFACE_ID_ERC721);
    }

    // function ownTokens(address _address) public view returns(uint[] memory){
    //     return _ownTokens[_address];
    // }

    function inqOwnLCT(address _address, uint8 typ) public view returns(uint[] memory){

        if(typ == 1){
            return lct[_address].copper();
        }else if(typ == 2){
            return lct[_address].silver();
        }else if(typ == 3){
            return lct[_address].gold();
        }else{
            revert("cat type error");
        }

    }

    function inqOwnLCTAmount(address _address, uint8 typ) public view returns(uint){

        if(typ == 1){
            return lct[_address].copperAmount();
        }else if(typ == 2){
            return lct[_address].silverAmount();
        }else if(typ == 3){
            return lct[_address].goldAmount();
        }else if(typ == 4){
            return lct[_address].copperAmount()
            .add(lct[_address].silverAmount())
            .add(lct[_address].goldAmount());
        }else{
            revert("cat type error");
        }
    }


    function balanceOf(address owner) public view returns (uint256) {
        require(owner != address(0), "ERC721: balance query for the zero address");

        return _ownedTokensCount[owner].current();
    }

    
    function ownerOf(uint256 tokenId) public view returns (address) {
        address owner = _tokenOwner[tokenId];
        require(owner != address(0), "ERC721: owner query for nonexistent token");

        return owner;
    }
    
    function approve(address to, uint256 tokenId) public {
        address owner = ownerOf(tokenId);
        require(to != owner, "ERC721: approval to current owner");

        require(_msgSender() == owner || isApprovedForAll(owner, _msgSender()),
            "ERC721: approve caller is not owner nor approved for all"
        );

        _tokenApprovals[tokenId] = to;
        emit Approval(owner, to, tokenId);
    }
    
    function getApproved(uint256 tokenId) public view returns (address) {
        require(_exists(tokenId), "ERC721: approved query for nonexistent token");

        return _tokenApprovals[tokenId];
    }
    
    function setApprovalForAll(address to, bool approved) public {
        require(to != _msgSender(), "ERC721: approve to caller");

        _operatorApprovals[_msgSender()][to] = approved;
        emit ApprovalForAll(_msgSender(), to, approved);
    }
    
    function isApprovedForAll(address owner, address operator) public view returns (bool) {
        return _operatorApprovals[owner][operator];
    }
    
    function transferFrom(address from, address to, uint256 tokenId) public {
        
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");

        _transferFrom(from, to, tokenId);
    }
    
    function safeTransferFrom(address from, address to, uint256 tokenId) public {
        safeTransferFrom(from, to, tokenId, "");
    }

    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory _data) public {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");
        _safeTransferFrom(from, to, tokenId, _data);
    }
    
    function _safeTransferFrom(address from, address to, uint256 tokenId, bytes memory _data) internal {
        _transferFrom(from, to, tokenId);
        require(_checkOnERC721Received(from, to, tokenId, _data), "ERC721: transfer to non ERC721Receiver implementer");
    }

    function _exists(uint256 tokenId) internal view returns (bool) {
        address owner = _tokenOwner[tokenId];
        return owner != address(0);
    }
    
    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view returns (bool) {
        require(_exists(tokenId), "ERC721: operator query for nonexistent token");
        address owner = ownerOf(tokenId);
        return (spender == owner || getApproved(tokenId) == spender || isApprovedForAll(owner, spender));
    }
    
    function _safeMint(address to, uint256 tokenId) internal {
        _safeMint(to, tokenId, "");
    }

    function _safeMint(address to, uint256 tokenId, bytes memory _data) internal {
        _mint(to, tokenId);
        require(_checkOnERC721Received(address(0), to, tokenId, _data), "ERC721: transfer to non ERC721Receiver implementer");
    }

    function _mint(address to, uint256 tokenId) internal {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        _tokenOwner[tokenId] = to;
        _ownedTokensCount[to].increment();

        if($luckyCats[tokenId].typ == 1){
            lct[to].plusCopper(tokenId);
            LCTAomunt.increment(1);
        }else if($luckyCats[tokenId].typ == 2){
            lct[to].plusSilver(tokenId);
            LCTAomunt.increment(2);
        }else if($luckyCats[tokenId].typ == 3){
            lct[to].plusGold(tokenId);
            LCTAomunt.increment(3);
        }else{
            revert("cat type error");
        }

        //_ownTokens[to].push(tokenId);
        

        emit Transfer(address(0), to, tokenId);
    }
    
    function _burn(address owner, uint256 tokenId) internal {
        require(ownerOf(tokenId) == owner, "ERC721: burn of token that is not own");

        _clearApproval(tokenId);

        _ownedTokensCount[owner].decrement();
        _tokenOwner[tokenId] = address(0);

        ///////////////////////////////

        // uint256[] storage fromTokens = _ownTokens[owner];
        // uint i;
        // for (i = 0; i < fromTokens.length; i++) {
        //     if (fromTokens[i] == tokenId) {
        //         break;
        //     }
        // }
        // assert(i < fromTokens.length);

        // fromTokens[i] = fromTokens[fromTokens.length - 1];
        // delete fromTokens[fromTokens.length - 1];
        // fromTokens.length--;

        if($luckyCats[tokenId].typ == 1){
            lct[owner].delCopper(tokenId);
            LCTAomunt.decrement(1);
        }else if($luckyCats[tokenId].typ == 2){
            lct[owner].delSilver(tokenId);
            LCTAomunt.decrement(2);
        }else if($luckyCats[tokenId].typ == 3){
            lct[owner].delGold(tokenId);
            LCTAomunt.decrement(3);
        }else{
            revert("cat type error");
        }

        /////////////////////////////

        emit Transfer(owner, address(0), tokenId);
    }

    function _burn(uint256 tokenId) internal {
        _burn(ownerOf(tokenId), tokenId);
    }
    
    function _transferFrom(address from, address to, uint256 tokenId) internal {
        require(ownerOf(tokenId) == from, "ERC721: transfer of token that is not own");
        require(to != address(0), "ERC721: transfer to the zero address");

        _clearApproval(tokenId);

        _ownedTokensCount[from].decrement();
        _ownedTokensCount[to].increment();

        _tokenOwner[tokenId] = to;

        ///////////////////////////////

        //_ownTokens[to].push(tokenId);

        if($luckyCats[tokenId].typ == 1){
            lct[to].plusCopper(tokenId);
            lct[from].delCopper(tokenId);
        }else if($luckyCats[tokenId].typ == 2){
            lct[to].plusSilver(tokenId);
            lct[from].delSilver(tokenId);
        }else if($luckyCats[tokenId].typ == 3){
            lct[to].plusGold(tokenId);
            lct[from].delGold(tokenId);
        }else{
            revert("cat type error");
        }

        // uint256[] storage fromTokens = _ownTokens[from];
        // uint i;
        // for (i = 0; i < fromTokens.length; i++) {
        //     if (fromTokens[i] == tokenId) {
        //         break;
        //     }
        // }
        // assert(i < fromTokens.length);

        // fromTokens[i] = fromTokens[fromTokens.length - 1];
        // delete fromTokens[fromTokens.length - 1];
        // fromTokens.length--;
        /////////////////////////////
        emit Transfer(from, to, tokenId);
    }
    
    function _checkOnERC721Received(address from, address to, uint256 tokenId, bytes memory _data)
        internal returns (bool){
            
        if (!to.isContract()) {
            return true;
        }

        bytes4 retval = IERC721Receiver(to).onERC721Received(_msgSender(), from, tokenId, _data);
        return (retval == _ERC721_RECEIVED);
    }
    
    function _clearApproval(uint256 tokenId) private {
        if (_tokenApprovals[tokenId] != address(0)) {
            _tokenApprovals[tokenId] = address(0);
        }
    }
}
